import App from "./App";
import Head from "next/head";
//require("bootstrap/dist/css/bootstrap.css");

const Index = () => {
  return (
    <div>
      <Head>
        <title>Todo-list App</title>
        <link rel="stylesheet" href="bootstrap.css" />
      </Head>
      <App />
    </div>
  );
};

export default Index;
